import { Route, useParams } from 'react-router-dom'
import Comments from '../components/comments/Comments'

export default function QuoteDetail() {
    const params = useParams()

    return (
        <>
            <h1>Quote Detail</h1>
            <p>{params.quoteId}</p>

            <Route path={`/quotes/${params.quoteId}/comments`}>
                <Comments/>
            </Route>
        </>
    )
}
